import './App.css';
import {character} from "./arrays"


async function getData() {
    let decision = Math.floor(Math.random() *3+1)
    console.log(decision)

    if(decision === 1){
        //Just NPC
        console.log(character.npc[Math.floor(Math.random()*character.npc.length)] )
        const npc = await fetch('https://api.open5e.comGET/monsters/?challenge_rating=&armor_class=&type=&name='+character.npc[Math.floor(Math.random()*character.npc.length)] +'&document=&document__slug='
        ).then(result => result.json());
        return npc

    }else if(decision === 2){
        //Just Monster
        console.log(character.monster.M1_5[Math.floor(Math.random()*character.monster.M1_5.length)])
        const monster = await fetch('https://api.open5e.comGET/monsters/?challenge_rating=&armor_class=&type=&name='+character.monster.M1_5[Math.floor(Math.random()*character.monster.M1_5.length)] +'&document=&document__slug='
        ).then(result => result.json());
        return monster

    } else if (decision === 3){
        //Both
        console.log(character.npc[Math.floor(Math.random()*character.npc.length)] + character.monster[Math.floor(Math.random()*character.monster.length)])
        const monster = await fetch('https://api.open5e.comGET/monsters/?challenge_rating=&armor_class=&type=&name='+character.monster.M1_5[Math.floor(Math.random()*character.monster.M1_5.length)] +'&document=&document__slug='
        ).then(result => result.json());
        const npc = await fetch('https://api.open5e.comGET/monsters/?challenge_rating=&armor_class=&type=&name='+character.npc[Math.floor(Math.random()*character.npc.length)] +'&document=&document__slug='
        ).then(result => result.json());
        return monster + " " + npc

    }


}







function RandomMonster() {

    return (
      <div className='App-header'>
        <button className='App' onClick={getData}>1-5</button>
        <button className='App'>6-10</button>
        <button className='App'>11-15</button>

      </div>
    );
}




export default RandomMonster;
